prompt --application/shared_components/security/authentications/heemo_dairy_farm_custom_authentication_scheme
begin
wwv_flow_imp_shared.create_authentication(
 p_id=>wwv_flow_imp.id(52256755465430270175)
,p_name=>'Heemo Dairy Farm Custom Authentication Scheme'
,p_scheme_type=>'NATIVE_CUSTOM'
,p_attribute_03=>'FARM_ACC_LOGIN'
,p_attribute_05=>'N'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION FARM_ACC_LOGIN',
'(',
'    P_USERNAME IN VARCHAR2, ',
'    P_PASSWORD IN VARCHAR2',
')',
'RETURN BOOLEAN',
'IS',
'    FAL_EMAIL VARCHAR2(50) := LOWER(P_USERNAME);',
'    FAL_PWD VARCHAR2(20) := P_PASSWORD;',
'    FAL_COUNT NUMBER;',
'BEGIN',
'    SELECT COUNT(*) INTO FAL_COUNT FROM CUSTOMER WHERE ',
'    EMAIL = FAL_EMAIL ',
'    AND',
'    PWD = FAL_PWD;',
'    IF FAL_COUNT = 0 THEN RETURN FALSE;',
'    ELSE RETURN TRUE;',
'    END IF;',
'EXCEPTION ',
'    WHEN OTHERS THEN RETURN FALSE;',
'END FARM_ACC_LOGIN;'))
,p_use_secure_cookie_yn=>'N'
,p_ras_mode=>0
);
end;
